export default class FindObject {
    findType: string;
    zipCode: number;
    distanceAway: number;

    constructor(findType: string = '', zipCode: number = 0, distanceAway: number = 0) {
        this.findType = findType;
        this.zipCode = zipCode;
        this.distanceAway = distanceAway;
    }
}
